import jsPDF from 'jspdf';

const oswaldFont = function () {
    const font = "";
    const font_bold = '';
    const callAddFont = function () {
        this.addFileToVFS('oswald.ttf', font);
        this.addFont('oswald.ttf', 'oswald', 'regular');
        this.addFileToVFS('oswald_bold.ttf', font_bold);
        this.addFont('oswald_bold.ttf', 'oswald', 'bold');
    };
    jsPDF.API.events.push(['addFonts', callAddFont]);
};

export default oswaldFont;